import ChartBar from './ChartBar'
import './Chart.css'

const Chart = ({ dataPoints }) => {

    let maxValue = Math.max(dataPoints.map( el => el.value ))

    return (
        <div>
        {
            dataPoints.map(
                dataPoint => <ChartBar
                    key={dataPoint.label}
                    value={dataPoint.value}
                    label={dataPoint.label}
                    maxValue={maxValue}
                />
            )
        }
        </div>
    )
}

export default Chart
